import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';
import { Route, Router } from '@angular/router';
import { NgToastService } from 'ng-angular-popup';
import ValidateForm from 'src/app/helpers/validateform';
import { AuthService } from 'src/app/services/auth.service';
import { UserStoreService } from 'src/app/services/user-store.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {

    type: string = "password";
    isText: boolean = false;
    eyeIcon: string = "fa-eye-slash";
    loginForm!: FormGroup;

    constructor(
      private fb: FormBuilder, 
      private auth: AuthService, 
      private router: Router,
      private toast: NgToastService,
      private userStore : UserStoreService){

    }

    ngOnInit(): void{
      this.loginForm = this.fb.group({
        username: ['',Validators.required],
        password: ['',Validators.required]
      })
    }

    hideShowPassword(){
      this.isText = !this.isText;
      this.isText ? this.eyeIcon = "fa-eye" : this.eyeIcon = "fa-eye-slash";
      this.isText ? this.type = "text" : this.type = "password";
    }

    onLogin(){
      if(this.loginForm.valid){

        //Send the object to database
        this.auth.login(this.loginForm.value)
        .subscribe({
          next:(res)=>{
            // alert(res.message);
            this.auth.storeToken(res.token);
            let tokenPayload = this.auth.decodeToken();
            this.userStore.setFullNameForStore
            this.toast.success({detail:"SUCCESS", summary:res.message, duration: 5000});
            this.loginForm.reset();
            this.router.navigate(['dashboard']);
          },
          error:(err)=>{
            // alert(err?.error.message)
            this.toast.error({detail:"ERROR", summary:"Something went wrong!", duration: 5000});
          }
        })
      }
      else{
        //throw error using toaster and with required field.
        ValidateForm.validateAllFormFields(this.loginForm);
        alert("Your form is invaild");
      }
    }

}

<div class="outer">
    <div class="container">
        <div class="row">
            <div class="offset-md-2 col-lg-5 col-md-7 offset-lg-4 offset-md-3">
                <div class="panel border bg-white">
                    <div class="panel-heading">
                        <h3 class="pt-3 font-weight-bold">Login</h3>
                    </div>
                    <div class="panel-body p-3">
                        <form [formGroup]="loginForm">
                            <div class="form-group pt-3">
                                <div class="input-field" [class.error]="loginForm.controls['username'].dirty && loginForm.hasError('required','username')">
                                    <span class="fa fa-user p-2"></span>
                                    <input formControlName="username" type="text" placeholder="Username">
                                </div>
                            </div>
                            <small *ngIf="loginForm.controls['username'].dirty && loginForm.hasError('required','username')" 
                                class="text-danger">*Username is required</small>
                            <div class="form-group pt-3">
                                <div class="input-field" [class.error]="loginForm.controls['password'].dirty && loginForm.hasError('required','password')">
                                    <span class="fa fa-lock p-2"></span>
                                    <input formControlName="password" [type]="type" placeholder="Password">
                                    <span class="fa {{ eyeIcon }}" (click)="hideShowPassword()"></span>
                                </div>
                            </div>
                            <small *ngIf="loginForm.controls['password'].dirty && loginForm.hasError('required','password')" 
                                class="text-danger">*Password is required</small>
                            <div class="form-inline fr mt-4">
                                <a id="forget" class="font-weight-bold">Forget Password?</a>
                            </div>
                            <button 
                                (click)="onLogin()"
                                type="submit" 
                                class="btn btn-primary btn-block mt-4 w-100">Login</button>
                            <div class="text-center pt-4 text-muted">Don't have account? <a id="forget" routerLink="/signup">Sign Up</a></div>
                        </form>
                    </div>
                    <div class="mx-3 my-2 py-2 bordert">
                        <div class="text-center py-3">
                            <a href="https://www.facebook.com" target="_blank" class="px-2"><img src="https://www.freepnglogos.com/uploads/aqua-blue-f-facebook-logo-png-22.png" alt="facebook"></a>
                            <a href="https://www.google.com" target="_blank" class="px-2"><img src="https://www.freepnglogos.com/uploads/google-favicon-logo-20.png" alt="google"></a>
                            <a href="https://www.outlook.com" target="_blank" class="px-2"><img src="https://www.freepnglogos.com/uploads/logo-outlook/outlook-transparent-save-outlook-png-icons-and-png-backgrounds-0.png" alt="outlook"></a>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
</div>
